import React from 'react';
import { TiUserOutline } from "react-icons/ti";
import { Link } from 'react-router-dom';

export default function NavBar(props) {
    const loggedout = () => {
        props.handleLogout();
    }

    return (
        <nav className="navbar fixed-top navbar-expand-lg navbar-dark bg-dark">
            <div className="container-fluid">
                <Link className="navbar-brand" to="/" style={{ marginLeft: "3px", marginBottom: "5px" }}>DeepDream</Link>
                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarSupportedContent"
                    aria-controls="navbarSupportedContent"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/Generation">Generate</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/Creativity">Personalize</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/Dreaming">Imagination</Link>
                        </li>
                    </ul>
                    <ul className="navbar-nav ml-auto">
                        <li className="nav-item">
                            <Link className="nav-link" to="/Profile">
                                <TiUserOutline
                                    style={{
                                        color: "black",
                                        marginBottom: "3px",
                                        backgroundColor: "white",
                                        borderRadius: "10px",
                                        height: "40px",
                                        width: "40px"
                                    }}
                                />
                            </Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}
